import React from 'react';


const ToDo = () => {

	return (
		<div>
			<li className="list-item">
				<span>Todo Title</span>
				<div>
					<button className="btn-delete-todo">Delete</button>
					<button className="btn-edit-todo">Edit</button>
				</div>
			</li>

		</div>
	);
};

export default ToDo;
